import '../styles/header.css';
const Header = ({text}) => {
  return (
    <div className="header-container">
      <div className="header-text">
        {text}
      </div>
      <img className="main-background-img" src="imgs/cute-doodle-flower-pattern.png" alt="배경화면"/>
    </div>
  );
}

export default Header;
